import React, {Component} from 'react';
import Header from "./components/Header";
import Search from "./components/Search";
import Movie from "./components/Movie";

class App extends Component {
    render() {
        return (
            <div>
                <Header/>
                <Search/>
                <Movie/>
            </div>
        );
    }
}

export default App;
